describe("List",function(){var b=window.utHelper;var a=b.prepare(["echarts/data/List"]);describe("Data Manipulation",function(){a("initData 1d",function(c){var d=new c(["x","y"]);d.initData([10,20,30]);expect(d.get("x",0)).toEqual(10);expect(d.get("x",1)).toEqual(20);expect(d.get("x",2)).toEqual(30);expect(d.get("y",1)).toEqual(20)});a("initData 2d",function(c){var d=new c(["x","y"]);d.initData([[10,15],[20,25],[30,35]]);expect(d.get("x",1)).toEqual(20);expect(d.get("y",1)).toEqual(25)});a("initData 2d yx",function(c){var d=new c(["y","x"]);d.initData([[10,15],[20,25],[30,35]]);expect(d.get("x",1)).toEqual(25);expect(d.get("y",1)).toEqual(20)});a("Data with option 1d",function(c){var d=new c(["x","y"]);d.initData([1,{value:2,somProp:"foo"}]);expect(d.getItemModel(1).get("somProp")).toEqual("foo");expect(d.getItemModel(0).get("somProp")).toBeNull()});a("Empty data",function(c){var d=new c(["x","y"]);d.initData([1,"-"]);expect(d.get("y",1)).toBeNaN()});a("Stacked data",function(d){var c=new d(["x",{name:"y",stackable:true}]);var e=new d(["x",{name:"y",stackable:true}]);c.initData([1,"-",2,-2]);e.initData([1,2,3,2]);e.stackedOn=c;expect(e.get("y",1,true)).toEqual(2);expect(e.get("y",2,true)).toEqual(5);expect(e.get("y",3,true)).toEqual(2)});a("getRawValue",function(c){var d=new c(["x","y"]);d.initData([1,2,3]);expect(d.getItemModel(1).option).toEqual(2);d.initData([[10,15],[20,25],[30,35]]);expect(d.getItemModel(1).option).toEqual([20,25])});a("getDataExtent",function(c){var d=new c(["x","y"]);d.initData([1,2,3]);expect(d.getDataExtent("x")).toEqual([1,3]);expect(d.getDataExtent("y")).toEqual([1,3])});a("Data types",function(c){var d=new c([{name:"x",type:"int"},{name:"y",type:"float"}]);d.initData([[1.1,1.1]]);expect(d.get("x",0)).toEqual(1);expect(d.get("y",0)).toBeCloseTo(1.1,5)});a("map",function(c){var d=new c(["x","y"]);d.initData([[10,15],[20,25],[30,35]]);expect(d.map(["x","y"],function(e,f){return[e+2,f+2]}).mapArray("x",function(e){return e})).toEqual([12,22,32])});a("mapArray",function(c){var d=new c(["x","y"]);d.initData([[10,15],[20,25],[30,35]]);expect(d.mapArray(["x","y"],function(e,f){return[e,f]})).toEqual([[10,15],[20,25],[30,35]])});a("filterSelf",function(c){var d=new c(["x","y"]);d.initData([[10,15],[20,25],[30,35]]);expect(d.filterSelf(["x","y"],function(e,f){return e<30&&e>10}).mapArray("x",function(e){return e})).toEqual([20])})})});